export default (state, action) => {
  console.log('test_redux-reducer_schedule', state, action)
	switch (action.type) {
		case 'INIT_SCHEDULE':
      return {shedule: [], textError: '', loadingFlag: false, authorization: false};

		case 'LOAD_SCHEDULE':
			return {shedule: [], textError: '', loadingFlag: true, authorization: false};

		case 'LOAD_SCHEDULE_FAILURE':
			return {shedule: [], textError: '', loadingFlag: false, authorization: false};

		case 'LOAD_SCHEDULE_SUCCESS':
      return {shedule: action.payload, textError: '', loadingFlag: false, authorization: true};

		default:
      return {shedule: [], textError: '', loadingFlag: false, authorization: false};
	}
};
